import appLogo from "./assets/media/images/logo.png";
const app = {
  title: "laphub",
  version: "1.0 beta",
  description:
    "Computer Store: Laptops - Pcs - Computer Accessories And Hardwares",
  logo: appLogo
};
export default app;
